import React, { useEffect, useMemo } from "react";
import "aos/dist/aos.css";
import "./styles/timetable.css";

const getStartOfWeek = (date) => {
  const current = new Date(date);
  const day = current.getDay();
  const diff = current.getDate() - day + (day === 0 ? -6 : 1); // Monday as the first day
  return new Date(current.setDate(diff));
};

const calculateTop = (time) => {
  const hours = time.getHours();
  const minutes = time.getMinutes();
  return hours * 60 + minutes; // Each minute corresponds to 1px
};

const calculateHeight = (startTime, endTime) => {
  const diff = (endTime - startTime) / 60000; // Convert milliseconds to minutes
  return diff;
};

const getTasksByDay = (tasks, weekDays) => {
  return weekDays.map((day) =>
    tasks.filter(
      (task) =>
        new Date(task.startTime).toDateString() === new Date(day).toDateString()
    )
  );
};

const renderTasks = (tasks, columnIndex) => {
  if (!tasks || tasks.length === 0) return null;

  const overlappingGroups = [];
  tasks.forEach((task, index) => {
    const overlappingGroup = overlappingGroups.find((group) =>
      group.some((t) =>
        task.startTime < t.endTime && task.endTime > t.startTime
      )
    );

    if (overlappingGroup) {
      overlappingGroup.push(task);
    } else {
      overlappingGroups.push([task]);
    }
  });

  return overlappingGroups.map((group, groupIndex) =>
    group.map((task, taskIndex) => {
      const startTop = calculateTop(task.startTime);
      const taskHeight = calculateHeight(task.startTime, task.endTime);
      const width = `calc(${100 / group.length}% - 5px)`;
      const left = `calc(${(100 / group.length) * groupIndex}% + ${taskIndex}px)`;

      return (
        <div
          key={`${columnIndex}-${groupIndex}-${taskIndex}`}
          className="task-item"
          style={{
            position: "absolute",
            top: `${startTop}px`,
            height: `${taskHeight}px`,
            width,
            left,
          }}
        >
          {task.name}
        </div>
      );
    })
  );
};

const TimeTable = ({ tasks }) => {
  const days = useMemo(
    () => ["Thứ 2", "Thứ 3", "Thứ 4", "Thứ 5", "Thứ 6", "Thứ 7", "Chủ Nhật"],
    []
  );
  const hours = useMemo(
    () =>
      Array.from({ length: 24 }, (_, i) => `${i}:00 - ${i + 1}:00`),
    []
  );

  const startOfWeek = useMemo(() => getStartOfWeek(new Date()), []);
  const weekDays = useMemo(
    () =>
      Array.from({ length: 7 }, (_, i) => {
        const day = new Date(startOfWeek);
        day.setDate(day.getDate() + i);
        return day;
      }),
    [startOfWeek]
  );

  const tasksByDay = useMemo(() => getTasksByDay(tasks, weekDays), [tasks, weekDays]);

  return (
    <div className="main-form" data-aos="zoom-in">
      <header className="search-bar">
        <h1>Weekly TimeTable</h1>
      </header>

      <div className="timetable-container">
        <div className="header-row">
          <div className="header-cell time-column">Thời gian</div>
          {days.map((day, index) => (
            <div key={index} className="header-cell">
              {day}
              <br />
              <span className="date-text">
                {weekDays[index].getDate()}/{weekDays[index].getMonth() + 1}
              </span>
            </div>
          ))}
        </div>

        <div className="body-container">
          <div className="time-column">
            {hours.map((hour, index) => (
              <div key={index} className="time-slot">
                {hour}
              </div>
            ))}
          </div>
          {days.map((_, index) => (
            <div key={index} className={`column column-${index}`}>
              {renderTasks(tasksByDay[index], index)}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default TimeTable;
